import React from 'react'
import Footer from '../components/Footer';
import Header from '../components/Header'

const Resume = () => {
    return (
        <div>
            <Header/>
            <div className='resume'>
            <h1>Resume</h1>
            </div>
            <Footer/>
        </div>
    );
};

export default Resume;
